            #region private (static) methods

            /// <summary>Computes the (symmetric) weights and abscissas of a specific Gauss-Legendre Quadrature.
            /// </summary>
            /// <param name="n">The order of the Gauss-Legendre Quadrature.</param>
            /// <param name="abscissas">The (<paramref name="n"/> + 1)/2 abscissas of the Gauss-Legendre Quadrature (output).</param>
            /// <param name="weights">The (<paramref name="n"/> + 1)/2 weights of the Gauss-Legendre Quadrature (output).</param>
            /// <param name="maxNumberOfRootIterations">The maximal number of iterations used for the Newton Approach.</param>
            /// <param name="tolerance">The (positive) tolerance used as exit condition for the Newton approach.</param>
            /// <exception cref="ArithmeticException">Thrown if a problem occurs while computing the roots of the Legendre polynomials.</exception>
            private static void ComputeCoefficients(int n, double[] abscissas, double[] weights, int maxNumberOfRootIterations = 1000, double tolerance = MachineConsts.SuperTinyEpsilon)
            {
                /* compute the zeros of the n-th Legendre-Polynomial, which is given via the recursive relation
                 * 
                 *  (j+1) * P_{j+1}(x) = (2j +1) * x * P_j(x) - j * P_{j-1}(x),
                 * 
                 *  p_0 = 1; p_1 = 0.
                 * 
                 * The derivative of P_n is given by [see formula (9.5.8c), 'Taschenbuch der Mathematik',
                 * Bronstein, 2. Edition, 1995]:
                 * 
                 *  (x^2-1) * P_n'(x) = n [ x * P_n(x) - P_{n-1}(x)]
                 * 
                 *  This makes it easy to apply the Newton-Method with a good initial value.
                 */
                for (int i = 0; i <= (n + 1) / 2 - 1; i++)  // a symmetric problem
                {
                    /* initial point of the Newton-Method: */
                    double x = Math.Cos(Math.PI * (i + 0.75) / (n + 0.5));

                    bool foundRoot = false;
                    int k = 1;

                    while ((k <= maxNumberOfRootIterations) && (foundRoot == false))
                    {
                        /* computes p_n(x): */
                        double pPreviousValue = 0.0;    // = p_0
                        double pValue = 1.0;   // = p_1

                        for (int j = 0; j <= n - 1; j++)
                        {
                            double pTempValue = pPreviousValue;
                            pPreviousValue = pValue;

                            pValue = ((2 * j + 1) * x * pPreviousValue - j * pTempValue) / (j + 1);
                        }
                        double derivative = n * (x * pValue - pPreviousValue) / (x * x - 1);
                        double xTemp = x;

                        /* use Newton's method: */
                        x = x - pValue / derivative;
                        if (Math.Abs(x - xTemp) < tolerance)
                        {
                            foundRoot = true;

                            abscissas[i] = x;
                            weights[i] = 2.0 / ((1 - x * x) * derivative * derivative);
                        }
                        k++;
                    }

                    if (k >= maxNumberOfRootIterations)
                    {
                        throw new ArithmeticException(String.Format("Could not compute the root of a specific Legendre polynomial of degree {0}; null-based index of the root: {1}.", n, i));
                    }
                }
            }
            #endregion
        }
    }
}